	doSet: function(start,moves,template,slot,teamDetails,iii){
		let validSets = [];
		if(moves.length === 4){
			for(let i = 0;i<iii;i++){
				let test = this.testSet(i,moves,template,slot,teamDetails);
				if( -1 !== test){
					let incompatibleMoves = ['bellydrum', 'swordsdance', 'calmmind', 'nastyplot'];
					let intersectMoves = test.moves.filter(move => incompatibleMoves.includes(move));
					if (intersectMoves.length > 1) continue;
					test.stats = omega.spreadModify(template.baseStats,test);
					validSets.push(test);
				}
			}
		}
		else{
			let movePool = (template.randomBattleMoves ? template.randomBattleMoves.slice() : Object.keys(template.learnset));
			for(let j = start;j<movePool.length-3+moves.length;j++){
				let set = this.doSet(j+1,moves.concat([movePool[j]]),template,slot,teamDetails,iii);
				validSets = validSets.concat(set);
			}
		}
		return validSets;
	},
