			'LC Uber': 86,
			NFE: 84,
			PU: 83,
			BL4: 82,
			NU: 81,
			BL3: 80,
			RU: 79,
			New: 79,
			BL2: 78,
			UU: 77,
			BL: 76,
			OU: 75,
			Uber: 73,
			AG: 71,
